Aquisição de bens de qualidade comum, conforme disposto no art. 20 da Lei 14.133/2021, de natureza continuada, sem fornecimento de mão de obra em regime de dedicação exclusiva, a ser contratado mediante Dispensa de Licitação.
Requisitos de Negócio (item 4.1. do Termo de Referência):
O sistema deve possuir capacidade mínima para processar a folha de pagamento mensal, para até 50 colaboradores na plataforma;
O sistema deverá ter capacidade mínima para acesso de 02 (dois) usuários (operadores) simultâneos, preferencialmente;
O fornecimento da licença deverá ocorrer por 12 (doze) meses; 
Atender à medição de nível de serviço (ANS) estabelecida no Termo de Referência;
